import classes from "./PlantProducts.module.css";

import img1 from "./../../../assets/Img1.webp";
import img2 from "../../../"
const DUMMY_DATA = [
  { id: "i1", text: "ALL PLANTS", imageSrc: img1 },
  { id: "i2", text: "POTS AND BASKETS", imageSrc: img1 },
  { id: "i3", text: "PET FRIENDLY", imageSrc: img1 },
  { id: "i4", text: "EASY CARE PLANTS", imageSrc: img1 },
  { id: "i5", text: "HANGING PLANTS", imageSrc: img1 },
  { id: "i6", text: "XL FLOOR STANDING PLANTS", imageSrc: img1 },
  { id: "i7", text: "MOSSBALLS", imageSrc: img1 },
  { id: "i8", text: "HOMEWARE", imageSrc: img1 },
];

const PlantProducts = () => {
  return (
    <div>
      <h1 className={classes.title}>SHOP BY CATEGORY</h1>
      <ul className={classes.list}>
        {DUMMY_DATA.map((item) => (
          <li>
            <img src={item.imageSrc} alt={item.text} />
            <p>{item.text}</p>
          </li>
        ))}
      </ul>
    </div>
  );
};
export default PlantProducts;
